cmd_calls:
  - name: pd4
    commands:
      - 'solvers/pd4/default-run.sh {file}'
    print_parameters:
      - file
      - default_parameters:
          memory: '16000'
        parameters: []
  - name: GPMC
    commands:
      - 'solvers/gpmc/gpmc -mode=2 {file}'
    print_parameters:
      - file
    instances:
      - default_parameters:
          memory: '16000'
        parameters: []
  - name: arjun
    commands:
      - 'solvers/sharpsat-td-arjun/starexec_run_track3_conf2.sh {file}'
    print_parameters:
      - file
    instances:
      - default_parameters:
          memory: '16000'
        parameters: []
    - name: d4-pmc
    commands:
      - 'solvers/d4/d4/bin/d4_static -i {file} -m counting'
    print_parameters:
      - file
    instances:
      - default_parameters:
          memory: '16000'
        parameters: []
    - name: slice
    commands:
      - './solvers/slicing/slice.sh {file}'
    print_parameters:
      - file
    instances:
      - default_parameters:
          memory: '16000'
        parameters: []
